import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      list: { id: 1, title: "north", comment: "abc" },
    };
  }

  render() {
    return <div>{this.state.list.map((item) => item)}</div>;
  }
}

export default App;
